import React from 'react'
import css from '../components/banner.css'

class Banner extends React.Component{
    constructor(props) {
        super(props)
      }
    render(){
        return(
            <div>
                <div>{this.props.text}</div>
                <img className={css.image} src={'../static/image-one.jpg'}/>
            </div>
        )
    }
}

export default Banner
